import React, { useState } from "react"

export default function Todos() {
  const [todos, setTodos] = useState([
    { id: 1, title: "study English" },
    { id: 2, title: "study Korean" },
  ])

  const render = todos.map((todo) => {
    return (
      <div key={todo.id}>
        <div>
          #{todo.id} / {todo.title}
        </div>
      </div>
    )
  })

  const addTod = () => {
    alert("add TODO!")
  }

  return (
    <div>
      <h1>Todos</h1>
      <input type="text" placeholder="New todo"></input>
      <button onClick={addTodo}>SEND</button>
      <div>{render}</div>
    </div>
  )
}
